import React, { useState, useEffect } from 'react';
import './Workout.css';
import Overview from '../Overview';
import KeyboardDoubleArrowLeftOutlinedIcon from '@mui/icons-material/KeyboardDoubleArrowLeftOutlined';

const Workout = () => {
  const [selectedComponent, setSelectedComponent] = useState(<DefaultPage />);

  useEffect(() => {
    setSelectedComponent(
      <WorkoutPage setSelectedComponent={setSelectedComponent} />
    );
  }, []);

  return <>{selectedComponent}</>;

}

export default Workout;

const WorkoutPage = ({ setSelectedComponent }) => {
  return (
    <div>
      <div className="header">
        <KeyboardDoubleArrowLeftOutlinedIcon onClick={() => setSelectedComponent(<Overview />)} />
        <p>Make Your WORKOUT PLAN!!!</p>
      </div>

    </div>
  )
}
